import { useNavigate } from "react-router-dom";
import "./Cabecalho.css";

function Cabecalho() {
  const navigate = useNavigate();
  return (
    <header className="Cabecalho">
      <img
        src="../Imagens/logo-libmap.png"
        alt=""
        onClick={() => {
          navigate("/");
        }}
      />
    </header>
  );
}
export default Cabecalho;
